    \ \uCE7C\uC744\uBCF4\uACE0 \uB450\uB824\uC6CC\uD569\uB2C8\uB2E4."
  p1626256393.3948078: "\uADF8\uB294 \uCC3D\uC5D0 \uAC78\uC5B4 \uADF8\uC758 creepy\
    \ \uC8FC\uBCC0\uC5D0 \uBC18\uC601. \uADF8\uB294 \uD56D\uC0C1 \uADF8\uB9BC \uAC19\
    \uC740 Falmouth\uB97C \uC0AC\uB791\uD588\uB2E4. \uB450\uB824\uC6C0\uC744 \uB290\
    \uB07C\uAE30 \uC704\uD574 \uADF8\uC758 \uACBD\uD5A5\uC744 \uACA9\uB824 \uD55C\
    \ \uACF3\uC785\uB2C8\uB2E4."
  p1626256393.3948088: "\uADF8\uB7F0 \uB2E4\uC74C \uADF8\uB294 \uAC70\uB9AC\uC5D0\uC11C\
    \ \uBB34\uC5B8\uAC00\uB97C \uBCF4\uC558\uB2E4, \uB610\uB294 \uC624\uD788\uB824\
    \ \uB204\uAD70\uAC00. \uADF8\uAC83\uC740 Ambien Cain\uC758 \uC778\uBB3C\uC774\uC5C8\
    \uB2E4. Ambien\uC740 \uB113\uC740 \uC804\uC7C1\uACFC \uB9E4\uC6B4 \uC18D\uB208\
    \uC379\uC744 \uAC00\uC9C4 \uCF54\uB07C\uB9AC\uB97C \uC0AC\uB791\uD588\uC2B5\uB2C8\
    \uB2E4."
  p1626256393.3948095: "\uC624\uD478\uC2A4 \uADF8\uB77C\uD504. \uADF8\uB294 \uC790\
    \uC2E0\uC758 \uBC18\uC0AC\uC5D0 \uB208\uC5D0 \uB744\uB294. \uADF8\uB294 \uBC30\
    \uACE0\uD504\uB2E4, clever, \uC640\uC778 \uB9C8\uCEE4\uC640 \uC218\uC5FC\uC804\
    \uACFC \uAC08\uC0C9 \uC18D\uB208\uC379. \uADF8\uC758 \uCE5C\uAD6C\uB294 \uB113\
    \uC740 \uBE5B, \uC57C\uC0DD wally\uB85C \uADF8\uB97C \uBCF4\uC558\uB2E4. \uD55C\
    \ \uBC88, \uADF8\uB294 \uC8FD\uACE0, \uBD80\uC0C1\uB41C \uC0C8\uB97C \uBD80\uD65C\
    \uD588\uC2B5\uB2C8\uB2E4."
  p1626256393.3948107: "\uADF8\uB7EC\uB098 \uD55C \uBC88 \uC8FD\uACE0, \uBD80\uC0C1\
    \uB41C \uC0C8\uB97C \uBD80\uD65C \uD55C \uC0AC\uB78C\uC774 \uBC30\uACE0\uD504\uB3C4\
    \ \uC624\uB298 \uC5B4\uB5A4 Ambien\uC774 \uC800\uC7A5 \uD55C \uAC83\uC744 \uC900\
    \uBE44\uD588\uC2B5\uB2C8\uB2E4."
  p1626256393.3948114: "\uBE44\uB294 \uB053\uB294 \uC0C8\uB97C \uB053\uB294 \uAC83\
    \uACFC \uAC19\uC774 \uD760\uBED1 \uCDE8\uD558\uBA70, Obfus ambivalent\uB97C \uB9CC\
    \uB4ED\uB2C8\uB2E4."
  p1626256393.3948123: "\uC678\uACFD\uC744 \uBC1F\uACE0 Ambien\uC774 \uB354 \uAC00\
    \uAE4C\uC774 \uC654\uC744 \uB54C, \uADF8\uB294 \uADF8\uC758 \uC5BC\uAD74\uC5D0\
    \ \uC6C3\uC74C\uC744 \uBCFC \uC218 \uC788\uC5C8\uB2E4."
  p1626256393.3948133: "\"\uB098\uB294 \uB0B4\uAC00 \uC815\uC758\uB97C \uC6D0\uD558\
    \uAE30 \uB54C\uBB38\uC5D0 \uC5EC\uAE30\uC5D0\uC788\uB2E4\", Ambien\uB294 \uB2EC\
    \uCF64\uD55C \uC74C\uC0C9\uC5D0\uC11C, \uBC30. \uADF8\uB294 5874 \uBE14\uB8E8\
    \ \uBCD1\uC758 \uD798\uACFC Obfus\uC758 \uAC00\uC2B4\uC5D0 \uB300\uD55C \uADF8\
    \uC758 \uC8FC\uBA39\uC744 \uC2AC \uACBC\uB2E4. \"\uB098\uB294 \uB2F9\uC2E0\uC744\
    \ \uC0AC\uB791\uD569\uB2C8\uB2E4, Obfus Curr\"."
  p1626256393.3948143: "Obfus\uB294 \uB4A4\uB97C, \uB354 \uC8FC\uC704\uB97C \uBCF4\
    \uACE0 \uC544\uC9C1\uB3C4 peculiar \uCE7C\uC744 \uC190\uAC00\uB77D\uC73C\uB85C\
    \ \uB9C9\uC2B5\uB2C8\uB2E4. \"Ambien, \uB098\uB294 \uB3C8\uC774 \uC5C6\uC5B4,\
    \ \uADF8\uB294 \uB300\uB2F5\uD588\uB2E4."
  p1626256393.3948152: "\uADF8\uB4E4\uC740 \uC11C\uB85C\uC5D0\uBCF4\uACE0 \uD65C\uC131\
